import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

const Results = () => {
    return (
        <div>
            <Header />
            <main>
            <h1>QuizResults</h1>
            <p>Your score is: {score} out of {total}</p>
            <p>You have completed the quiz</p>
            </main>
            <Footer />
        </div>
    );
};
export default Results;
